processPrePosts.script:
tw.local.sslParameters = null;
if (tw.local.WebServerConfig.URL && tw.local.WebServerConfig.URL.toUpperCase().indexOf("HTTPS:") == 0) {
if (tw.local.WebServerConfig.ignoreCert == true){
tw.local.sslParameters = new tw.object.Map();
tw.local.sslParameters.put("TrustTargetServer", true);
tw.local.sslParameters.put("IgnoreCertHostname", true);
} else {
tw.local.sslParameters = new tw.object.Map();
tw.local.sslParameters.put("TrustTargetServer", false);
tw.local.sslParameters.put("IgnoreCertHostname", false);
}
}

